        "\n",
        "def count_occupancy(result):\n",
        "    import numpy as np\n",
        "    cls = result.boxes.cls.cpu().numpy().astype(int) if len(result.boxes) else np.array([])\n",
        "    empty = int((cls == 0).sum())\n",
        "    occupied = int((cls == 1).sum())\n",
        "    total = empty + occupied\n",
        "    rate = float((occupied / total * 100) if total else 0.0)\n",
        "    return empty, occupied, rate\n",
        "\n",
        "test_img_dir = Path(yaml_path).parent / \"test\" / \"images\"\n",
        "imgs = list(test_img_dir.glob(\"*.jpg\")) + list(test_img_dir.glob(\"*.jpeg\")) + list(test_img_dir.glob(\"*.png\"))\n",
        "assert imgs, \"No test images found\"\n",
        "img_path = str(imgs[0])\n",
