        "\n",
        "res = best.predict(source=img_path, conf=0.45, save=True, project=\"runs/detect\", name=\"predict\", exist_ok=True)\n",
        "r = res[0]\n",
        "empty, occupied, rate = count_occupancy(r)\n",
